import Contact from '../contact/Contact'


class Contacts extends Component {
    state = {
        contacts : [
            { id: 1, nom: 'mohammed bjj', tel:'0222645654', email: 'med@kke.com'},
            { id: 2, nom: 'mohammed sss', tel:'02225445654', email: 'meddd@kke.com'},
            { id: 3, nom: 'mohammed ddd', tel:'0222665654', email: 'mezzzd@kke.com'}
        ]
    }

    deleteContat = (id) => {
        console.log("deleted contacts !!");
    }
    render() {
        const { contacts } = this.state;
        return (
            <Fragment>
               { 
                contacts.map(contact => (
                   <div className = "col-2 m-3">
                        <Contact data= {contact} deleteContactFromChild={this.deleteContat.bind(this, contact.id)} />
                   </div>
               ))}
            </Fragment>
        )
    }
}


export default Contacts;
